import React, { useState } from "react";
import {continents}  from "./section/datas";

function Radio() {
    const [Filter,FilterState] = useState([continents])
    return (
        <div>
            <input className="radioInput" type="radio" value={Filter[0]} />
        </div>
    )
}

export default Radio;
